import React, { Component } from 'react';
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: null,
    };
  }
  componentDidMount() {
    fetch('https://www.googleapis.com/content/v2/143862545/products/')
      .then(response => response.json())
      .then(data => this.setState({ data }));

  }
  render(){
    return(
      <>
      hello from app
      {

        console.log(this.state.data)
      }
      </>
    )
  }
}
export default App;

